import React from 'react'

const directions = [
    { title: 'Direction 1', image: require('../assets/image1.svg') },
    { title: 'Direction 2', image: require('../assets/image2.svg') },
    { title: 'Direction 3', image: require('../assets/image3.svg') },
    { title: 'Direction 4', image: require('../assets/image4.svg') },
    { title: 'Direction 5', image: require('../assets/image5.svg') },
    { title: 'Direction 6', image: require('../assets/image6.svg') },
    { title: 'Direction 7', image: require('../assets/image7.svg') },
    { title: 'Direction 8', image: require('../assets/image8.svg') }
]

const About = () => {
  return (
    <div className='grid grid-cols-4 gap-4 bg-grey-dark'>
      {directions.map(direction => (
        <div key={direction.title}>
          <img src={direction.image} alt={direction.title} />
          <p>{direction.title}</p>
        </div>
      ))}
    </div>
  )
}

export default About
